import "./edu.scss";
import { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css'; // You can also use <link> for styles
import { LocationCity, DateRange } from "@material-ui/icons";
import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";

export default function Works() {
  useEffect(() => {
    setTimeout(function () {
      AOS.init({
        delay: 2, // values from 0 to 3000, with step 50ms
        duration: 1000, // values from 0 to 3000, with step 50ms
        easing: 'ease', // default easing for AOS animations
      });
    }, 7000);

    const handleMouseMove = (e) => {
      let width = window.innerWidth;
      let normalizedPosition = e.pageX / (width / 2) - 1;
      let speedSlow = 100 * normalizedPosition;
      let speedFast = 200 * normalizedPosition;

      document.querySelectorAll('.spanSlow').forEach((span) => {
        span.style.transform = `translate(${speedSlow}px)`;
      });

      document.querySelectorAll('.spanFast').forEach((span) => {
        span.style.transform = `translate(${speedFast}px)`;
      });
    };

    const handleWindowResize = () => {
      // This function can be used to handle any specific behavior on window resize if needed.
    };

    window.addEventListener('mousemove', handleMouseMove);
    window.addEventListener('resize', handleWindowResize);

    return () => {
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('resize', handleWindowResize);
    };
  }, []);

  const timelineElements = [
    {
      id: 1,
      title: "Bachelors in Information and Communication Technology",
      location: "Ahmedabad University, Gujarat, India",
      description: "Information and Communication Technology CGPA: 3.21/4.0",
      date: "June 2018 - May 2022",
      icon: "school",
    },
    {
      id: 2,
      title: "Masters of Computer Science (MCS)",
      location: "Arizona State University, Tempe, Arizona",
      description: "",
      date: "August 2023 - May 2025 Expected",
      icon: "school",
    },
  ];

  return (
    <div className="edu" id="edu">
      <div className="wrap">
        {timelineElements.map((element, index) => (
          <div className="line" key={index}>
            <div className="left">
              <div className="content">
                <span className="spanSlow">{element.title}</span>
              </div>
            </div>
            <div className="right">
              <div className="content">
                <span className="spanSlow">{element.title}</span>
              </div>
            </div>
            <div className="left">
              <div className="content">
                <span className="spanFast"><LocationCity /> {element.location}</span>
              </div>
            </div>
            <div className="right">
              <div className="content">
                <span className="spanFast"><LocationCity /> {element.location}</span>
              </div>
            </div>
            <div className="left">
              <div className="content">
                <span className="spanSlow"><DateRange /> {element.date}</span>
              </div>
            </div>
            <div className="right">
              <div className="content">
                <span className="spanSlow"><DateRange /> {element.date}</span>
              </div>
            </div>
            {element.description && (
              <div className="left">
                <div className="content">
                  <span className="spanFast">{element.description}</span>
                </div>
              </div>
            )}
            {element.description && (
              <div className="right">
                <div className="content">
                  <span className="spanFast">{element.description}</span>
                </div>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
